void Graphics_ViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &b_toNextScreen)
    {
        //toNextScreen
        //When b_toNextScreen clicked change screen to Discret_
        //Go to Discret_ with no screen transition
        application().gotoDiscret_ScreenNoTransition();
    }
    else if (&src == &b_toPrevScreen)
    {
        //toPrevScreen
        //When b_toPrevScreen clicked change screen to Graphics_
        //Go to Graphics_ with no screen transition
        application().gotoGraphics_ScreenNoTransition();
    }
    else if (&src == &tb_1)
    {
        //chooseRB_1
        //When tb_1 clicked call virtual function
        //Call chooseRB_1
        chooseRB_1();
    }
    else if (&src == &tb_2)
    {
        //chooseRB_2
        //When tb_2 clicked call virtual function
        //Call chooseRB_2
        chooseRB_2();
    }
    else if (&src == &tb_3)
    {
        //chooseRB_3
        //When tb_3 clicked call virtual function
        //Call chooseRB_3
        chooseRB_3();
    }
    else if (&src == &tb_4)
    {
        //chooseRB_4
        //When tb_4 clicked call virtual function
        //Call chooseRB_4
        chooseRB_4();
    }
}
